.experts {
    &__container {
        @media(max-width:570.98px){
            padding: 0rem 0rem !important;
        }
    }
    
    &__block {
        margin-top: 6.25rem;
        font-family: "Montserrat-SemiBold";
        line-height: 160%;

        background: white;

        color: #2D2D2D;
        @include adaptiv-value(margin-top, 6.25, 2.2, 1)
    }

    &__img {
        position: absolute;
        display: flex;
        width: 43.75rem;
        height: 40.875rem;
        left: 5%;

        @media(max-width:1280.98px) {
            height: 36rem;
            width: 37rem;
            left: 6%;
        }
        @media(max-width:1100.98px) {
            height: 34.6rem;
            width: 35rem;
            left: 7%;
            object-fit: cover;
        }
        
        @media(max-width:991.98px) {
            width: 30rem;
            height: 28rem;
            object-fit: cover;
        }

        @media(max-width:940.98px) {
            width: 23rem;
            height: 22rem;
            left: 1%;
        }

        @media(max-width:660.98px) {
            width: 15.5rem;
            height: 18.5rem;
        }

        @media(max-width:570.98px) {
            position: static;
            object-fit: cover;
            max-width: 18.875rem;
            flex: 1;
            max-height: 18rem;
            margin-bottom: 2vw;
        }
        @media(max-width:425.98px) {
            margin-bottom: 6vw;
        }
    }

    &__title {
        font-size: 2.5rem;
        text-decoration-line: underline;
        margin-bottom: 1.7rem;
        text-underline-position: under;

        @media(max-width:1280.98px) {
            font-size: 1.6rem;
        }

        @media(max-width:768.98px) {
            font-size: 1.2rem;
            margin-bottom: 1.3rem;
        }

        @media(max-width:425.98px) {
            font-size: 6.5vw;
            line-height: 100%;
        }
    }

    &__main {
        position: relative;
        display: flex;
        align-items: center;
        justify-content: center;
        border: 0.125rem solid rgb(63, 60, 60);
        border-radius: 0.125rem;
        margin-bottom: 3.5rem;
        background: #F5F5F5;
        outline: 0.875rem solid #F5F5F5;
        height: 38.5rem;

        @media(max-width:1280.98px) {
            max-height: 34.375rem;
        }
        @media(max-width:1100.98px) {
            max-height: 32.375rem;
        }
        @media(max-width:991.98px) {
            height: 25rem;
        }

        @media(max-width:940.98px) {
            height: 21rem;
        }
        @media(max-width:660.98px) {
            height: 18rem;
        }
        @media(max-width:570.98px) {
            max-height: 18.75rem;
            padding: 0.3rem 0.3rem 1rem 0.3rem;
            flex-flow: wrap row;
            max-height: none;
            height: auto;
            justify-content: left;
            border: none;
            outline: none;
        }

        @media(max-width:425.98px) {
            justify-content: center;
        }
        @media(max-width:375.98px) {
            justify-content: center;
        }

        &-hori {
            white-space: nowrap;
            height: 1.25rem;
            font-size: 1rem;
            line-height: 140%;
            transform: rotate(-90deg);

            @media(max-width:991.98px) {
                font-size: 0.781rem;
                height: 0.7rem;
            }

            @media(max-width:940.98px) {
                width: 0;
                font-size: 0;
                line-height: 0;
                opacity: 0;
                position: absolute;
                top: -2000%;
                left: -50%;
            }
        }
    }

    &__horizontal {
        display: flex;
        align-items: center;
        flex: 0 0 1rem;
        width: 1rem;
        justify-content: center;
        margin-left: 1rem;
        margin-right: 5rem;

        @media(max-width:1599.98px) {
            margin-right: 5vw;
        }

        @media(max-width:940.98px) {
            margin: 0;
        }

        @media(max-width:940.98px) {
            width: 0;
            font-size: 0;
            line-height: 0;
            opacity: 0;
            position: absolute;
            top: -2000;
        }
    }

    &__textwrap {
        display: flex;
        justify-content: flex-end;
        flex: 1 1 100%;
        @media(max-width:425.98px) {
            flex: unset;
        }
        @media(max-width:375.98px) {
            justify-content: center;
        }
    }
    &__toptext{
        margin-bottom: 6.625rem;
        @media(max-width:991.98px){
            margin-bottom: 4rem;
        }
        @media(max-width:768.98px){
            margin-bottom: 2rem;
        }
    }
    
    &__text {
        max-width: 31.25rem;

        @media(max-width:1280.98px) {
            max-width: 25rem;
        }
        @media(max-width:1100.98px) {
            max-width: 22rem;
        }
        @media(max-width:991.98px) {
            max-width: 21.875rem;
        }

        @media(max-width:768.98px) {
            max-width: 17.5rem;
        }
        @media(max-width:425.98px){
            max-width: 19.5rem;
        }
        @media(max-width:375.98px){
            max-width: 17.5rem;
        }
    }

    &__info {
        font-family: "Montserrat-Light";
        line-height: 160%;
        font-size: 1rem;
        @include mb(0.75rem);

        @media(max-width:1280.98px) {
            line-height: 120%;
            font-size: 0.8rem;
        }
        @media(max-width:768.98px) {
            @include mb(0.5rem);
        }
        @media(max-width:425.98px) {
            line-height: 120%;
            font-size: 4vw;
        }

        &-bold {
            font-family: "Montserrat-SemiBold";
            font-size: 1.75rem;

            @media(max-width:1280.98px) {
                font-size: 1.2rem;
            }

            @media(max-width:991.98px) {
                font-size: 0.8rem;
            }

            @media(max-width:425.98px) {
                font-size: 4vw;
            }
        }

        &-minibold {
            font-family: "Montserrat-SemiBold";
            font-size: 1rem;

            @media(max-width:1280.98px) {
                font-size: 0.8rem;
            }
        }
    }

    &__bottom {
        &-wrapper {
            display: flex;
            align-items: center;
            justify-content: space-between;

            @media(max-width:550.98px) {
                flex-flow: column;
            }

        }

        &-comandtitle {
            font-family: "Montserrat-SemiBold";
            font-size: 2.5rem;
            line-height: 160%;
            color: $primary;
            margin-bottom: 2.5rem;

            @media(max-width:1280.98px) {
                font-size: 2rem;
                line-height: 140%;
            }

            @media(max-width:991.98px) {
                font-size: 1.5rem;
                line-height: 140%;
                margin-bottom: 1.5rem;
            }

            @media(max-width:940.98px) {
                margin-bottom: 1rem;
                font-size: 1.2rem;
            }
        }

        &-comandsvg {
            @media(max-width:991.98px) {
                width: 150px;
                height: 150px;
            }

            @media(max-width:940.98px) {
                width: 100px;
                height: 100px;
            }

            @media(max-width:550.98px) {
                width: 150px;
                height: 150px;
            }
        }

        &-block {
            max-width: 487px;

            @media(max-width:1440.98px) {
                width: 30vw;
                height: 35vw;
            }

            @media(max-width:940.98px) {
                width: 25vw;
                height: 33vw;
            }

            @media(max-width:768.98px) {
                width: 30vw;
                height: 40vw;
            }

            @media(max-width:550.98px) {
                width: 60vw;
                height: 70vw;
            }

            @media(max-width:425.98px) {
                // width: 65vw;
                // height: 80vw;
                width: 80vw;
                height: 90vw;
            }
        }

        &-comand {
            display: flex;
            flex-direction: column;
            align-items: center;

            @media(max-width:550.98px) {
                width: 100%;
                margin: 1.5rem 0 2.3rem 0;
            }

            @media(max-width:370.98px) {
                width: 100%;
                margin: 2rem 0 2.3rem 0;
            }
        }

        &-name {
            font-family: "Montserrat-Medium";
            font-size: 1.25rem;
            line-height: 160%;

            @media(max-width:991.98px) {
                font-size: 1rem;
            }
        }

        &-job {
            color: $gray;
            font-family: "Montserrat-Light";
            font-size: 1rem;
            line-height: 140%;

            @media(max-width:991.98px) {
                font-size: 0.8rem;
            }
        }
    }
}

